import React, { Component } from 'react'

class NavMenu extends Component {
    
    
    constructor(props) {
        super(props)
    
        this.state = {
             questionToJump:""
        }
    }
    
    onQuestion1 = (event) => {
        event.preventDefault();
        
        this.setState({
            currentAnswerValue: "q1"
        }, () => {
            this.onSubmit();
        })
        

    }

    onQuestion1a = (event) => {
        event.preventDefault();
        
        this.setState({
            currentAnswerValue: "q1a"
        }, () => {
            this.onSubmit();
        })

    }

    onQuestion2 = (event) => {
        event.preventDefault();
        
        this.setState({
            currentAnswerValue: "q2"
        }, () => {
            this.onSubmit();
        })
        

    }

    onQuestion3 = (event) => {
        event.preventDefault();
        
        this.setState({
            currentAnswerValue: "q3"
        }, () => {
            this.onSubmit();
        })
        

    }

    onQuestion4 = (event) => {
        event.preventDefault();
        
        this.setState({
            currentAnswerValue: "q4"
        }, (event) => {
            this.onSubmit();
        })
        

    }

    onSubmit = () => {
        const currentAnswerValue = this.state.currentAnswerValue;
        console.log(currentAnswerValue);

        if(currentAnswerValue === "q1"){
            this.props.onSubmit(currentAnswerValue);
        }

        if(currentAnswerValue === "q1a"){
            this.props.onSubmit(currentAnswerValue);
        }

        if(currentAnswerValue === "q2"){
            this.props.onSubmit(currentAnswerValue);
        }

        if(currentAnswerValue === "q3"){
            this.props.onSubmit(currentAnswerValue);
        }

        if(currentAnswerValue === "q4"){
            this.props.onSubmit(currentAnswerValue);
        }
    }


    render() {
        const jumpq1background = (this.props.valeuq1.length > 0) ? "rgb(90, 114, 192)" : "";

        return (
            <div>
                <div className="navigation-buttons-container">
                    <h1>Jump to....</h1>
                    <button type="submit" className="jump-question-btn" style={{backgroundColor: jumpq1background}} onClick={this.onQuestion1}>Question 1</button>

                    {this.props.renderQ1a === true && (
                        <button type="submit" className="jump-question-btn" onClick={this.onQuestion1a}>Question 1a</button>
                    )} 
                    
                    <button type="submit" className="jump-question-btn" onClick={this.onQuestion2}>Question 2</button>
                    
                    <button type="submit" className="jump-question-btn" onClick={this.onQuestion3}>Question 3</button>
                    
                    <button type="submit" className="jump-question-btn" onClick={this.onQuestion4}>Question 4</button>
                </div>
            </div>
        )
    }
}

export default NavMenu
